%script

create or replace function get_token2 (
  p_url       varchar2,
  p_username  varchar2,
  p_password  varchar2,
  p_verbose   number default 0) 
  return varchar2
  authid definer as pragma autonomous_transaction;
  l_buffer            varchar2(4000);
  l_request_content   clob;
  l_response_content  clob;
  l_request           utl_http.req;
  l_response          utl_http.resp;
  l_url               varchar2(1000);
  l_smt               varchar2(1000);
  l_access_token      varchar2(4000);
begin
  l_url := p_url;
  l_request_content := q'[{"grant_type":"password", "username":"]' || p_username || q'[", "password":"]' || p_password ||
  q'["}]';
  begin
    utl_http.set_wallet('');
    l_request := utl_http.begin_request(l_url,'POST',' HTTP/1.1');
    utl_http.set_header(l_request,'Content-Type','application/json');
    utl_http.set_header(l_request,'Accept','application/json');
    utl_http.set_header(l_request,'Content-Length',length(l_request_content));
    utl_http.write_text(l_request,l_request_content);
    l_response := utl_http.get_response(l_request);
    if (l_response.status_code != utl_http.HTTP_OK) THEN
      RAISE_APPLICATION_ERROR(-20999, 'Token request failed with status code: '||l_response.status_code||', reason: '||l_response.reason_phrase);
    end if;
    if p_verbose > 0 then
      dbms_output.put_line('HTTP response status code: ' || l_response.status_code);
      dbms_output.put_line('HTTP response reason phrase: ' || l_response.reason_phrase);
    end if;
    begin
      loop
        utl_http.read_line(l_response,l_buffer);
        l_access_token := regexp_substr(l_buffer,'"accessToken":"([^"]+)"',1,1,'i',1);
        if p_verbose > 0 then
          dbms_output.put_line('l_access_token: [' || l_access_token || ']');
        end if;
      end loop;
      utl_http.end_response(l_response);
    exception
      when utl_http.end_of_body then utl_http.end_response(l_response);
    end;
  end;
  return(l_access_token);
  dbms_output.put_line('Access token is: ' || l_access_token);
end get_token2;
/

