CREATE TABLE ACCESS_DETAILS (
  NAME  VARCHAR2(20),
  VALUE VARCHAR2(1000)
  );
/

--provide OML token URL, USERNAME, and PASSWORD for token acquisition

INSERT INTO ACCESS_DETAILS VALUES ('URL', '<enter OML token URL here>');
INSERT INTO ACCESS_DETAILS VALUES ('USERNAME', '<enter OML username here>');
INSERT INTO ACCESS_DETAILS VALUES ('PASSWORD', '<enter OML passowrd here>');

%script

DECLARE
   access_token VARCHAR2(2000);
   is_set BOOLEAN;
BEGIN
   with url_string  as (select VALUE from ACCESS_DETAILS where NAME = 'URL'), 
        username    as (select VALUE from ACCESS_DETAILS where NAME = 'USERNAME'),
        pswd        as (select VALUE from ACCESS_DETAILS where NAME = 'PASSWORD')
   SELECT get_token2(url_string.VALUE, username.VALUE, pswd.VALUE) INTO access_token 
   FROM url_string, username, pswd 
   WHERE localtimestamp=localtimestamp;

   rqSetAuthToken(access_token);
     is_set := rqIsTokenSet();
     IF (is_set) THEN
        DBMS_OUTPUT.put_line ('token is set');
       --enable to return token
       --DBMS_OUTPUT.put_line (''|| access_token);
    END IF;
END;

